// Men.js
import React from 'react';
import Productdata from './Productdata';
import Data from './Data';

const Men = () => {
  const menProducts = Data.slice(4, 8); // Slicing the data to get products with IDs 5 to 8

  console.log(menProducts); // Add this line to check the sliced data in the console

  return (
    <div className="product">
      <h1>Men's Products</h1>
      <div className="product-list">
        {menProducts.map((product) => (
          <Productdata
            key={product.id}
            image={product.image}
            title={product.title}
            des={product.des}
            price={product.price}
            color={product.color}
            size={product.size}
          />
        ))}
      </div>
    </div>
  );
}

export default Men;
